import React from 'react';

export default class Log extends React.Component {
  state = {
    name: '',
  };
  changeTitle = (ev) => {
    this.setState({ name: ev.target.value });
  };

  Ren = (evw) => {
    evw.preventDefault();
    this.props.Ren(this.state.name);
  };

  render() {
    return (
      <form onSubmit={this.Ren}>
        <input type='text' onChange={this.changeTitle} />

        <button>
          <b> Login in</b>
        </button>
      </form>
    );
  }
}
